import React from "react";
import { View,
         Text,
         StyleSheet,
         TouchableOpacity } from "react-native";
import { MaterialIcons } from '@expo/vector-icons'; 

export default function PostsScreen() {
  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <View style={styles.wrapper}>
          <Text style={styles.title}>Публикации   
          </Text>
          <TouchableOpacity style={styles.logoutBtn} marginLeft={50}>        
            <MaterialIcons 
              name="logout" size={24}
              style={styles.logout}/> 
            </TouchableOpacity>  
        </View> 
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    width: 375,
    maxHeight: 812,
  },
  logoutBtn:{
    maxWidth: 24,
    backgroundColor: "transparent",
    borderColor: "none",
  },
  header: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
    padding: 11,
    maxHeight: 88,
    borderBottomWidth: 1,
    borderColor: "#c3c3c3",
  },
  wrapper:{
    flex: 1
  },
  logout:{
    color: "#c3c3c3",
    marginLeft: "auto", 
  },
  title:{
    textAlign: "center",
    maxWidth: 175,
    color: "#212121",
    fontWeight: 500,
    fontSize: 17,
    lineHeight: 22,
  }
});
